import React from 'react';
import ReactDOM from 'react-dom';
import { Editor } from '@craftjs/core';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <Editor>
      <App />
    </Editor>
  </React.StrictMode>,
  document.getElementById('root')
);
